  [],\n\t\"revision_timestamp\": \"2015-09-26T23:04:48.662265\",\n\t\"name\": \"coastal-resources-atlas-long-island-reptiles-reptile-and-amphibian-polygons\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains sensitive biological
  resource data for sea turtles, estuarine turtles, and amphibians for Long Island,
  New York. Vector polygons in this data set represent turtle and amphibian distribution.
  Species-specific abundance, seasonality, status, life history, and source information
  are stored in relational data tables (described below) designed to be used in conjunction
  with this spatial data layer.This data set comprises a portion of the Environmental
  Sensitivity Index (ESI) data for Long Island. ESI data characterize the marine and
  coastal environments and wildlife by their sensitivity to spilled oil. The ESI data
  include information for three main components: shoreline habitats, sensitive biological
  resources, and human-use resources.\",\n\t\"license_title\": null,\n\t\"extras\":
